export const COLUMNS = [
    {
        Header : 'Id',
        accessor : 'id',
        Footer : 'Id'
    },
    {
        Header : 'First Name',
        accessor : 'first_name',
        Footer : 'First Name'
    },
    {
        Header : 'Last Name',
        accessor : 'last_name',
        Footer : 'Last Name'
    },
    {
        Header : 'Email',
        accessor : 'email',
        Footer : 'email'
    },
    {
        Header  : 'Gender',
        accessor : 'gender',
        Footer : 'Geder'
    },
    {
        Header : 'Date of Birth',
        accessor : 'dob',
        Footer : 'Date of Birth'
    }
]

export const GROUPED_CoLUMNS = [
